import React from 'react';
import ReactDOM from 'react-dom';

class SingleCard extends React.Component() {

    imagesArray =['stewie.jpg'];
    render() {
        let rand = Math.random(imagesArray) >= 0.5;
        return (
            <img 
            src = {this.imagesArray[this.imagesArray]}
            alt = 'alt' />
        );
    }
}

function Card(props) {
    return (
      <div className="card text-center">
        <div className="card-header">
          <h2>{props.heading}</h2>
        </div>
        <div className="card-body">{props.children}</div>
      </div>
    );
  }

  ReactDOM.render(<SingleCard />, document.getElementsByClassName('card-body'))


export default Card;
